class Dog extends Component {
  constructor(props) {
    super(props)
  }

  fetchDog = async () => {
      const url = 'https://dog.ceo/api/breeds/image/random'
      const response = await fetch(url);
      const apiDog = await response.json();
  }

  componentDidMount() {
    this.fetchDog();
  }

  render() {
    return(
      <div>
        <h1>
          Lista de cachorros.
        </h1>
        <button>Adicionar nova imagem</button>
      </div>  
    );
  }
}

export default Dog;
